import matplotlib.pyplot as plt
def generate_trajectory_plot(x, y, output_file):
    plt.plot(x, y)
    plt.scatter(x, y, color='red')
    plt.xlabel('X')
    plt.ylabel('Y')
    plt.title('Trajectory Plot')
    plt.savefig(output_file)
    plt.show()
